import React from 'react';
import { Col, Container, Row } from 'react-bootstrap';

//component
import ListLatestPlayers from '../../reportType/ListLatestPlayers'
import CardTopPlayers from '../../players/component/CardTopPlyers';
import PieChartAllReports from '../../reportType/PieChartAllReports';
import ListReportsTypeOfRegion from '../../reportType/ListReportsTypeOfRegion';
//css
import './homepage.scss'

const HomePage = () => {

    return (
        <Container fluid>
            <Row>
                <Col className='list-top-players '>
                    <h2>Top reported</h2>
                    <CardTopPlayers />
                </Col>
                <Col className='list-last-report'>
                    <h2>Last report</h2>
                    <ListLatestPlayers/>
                </Col>
                <Col className='list-latest-players'>
                    <h2>Report type</h2>
                    <ListReportsTypeOfRegion/>
                </Col>
            </Row>
        </Container>
    );

}
export default HomePage;
